import React, { useState } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faSearch } from '@fortawesome/free-solid-svg-icons';
import './index.css';
import { Link } from 'react-router-dom';

const Navbar = () => {
  const [searchField, setSearchField] = useState('');

  const handleSearchChange = (e) => {
    setSearchField(e.target.value);
  };

  return (
    <header>
      <nav className="navbar" aria-label="Main navigation">
        <h1>BE DAMASCENE</h1>
        <div className="links">
          <Link to="/" aria-label="Home">Home</Link>
          <Link to="/lessons" aria-label="Lessons">Lessons</Link>
          <Link to="/community" aria-label="Community">Community</Link>
          <Link to="/culture" aria-label="Culture">Culture</Link>
          <Link to="/account" aria-label="Account">Account</Link>
          <Link to="/contact" aria-label="Contact Us">Contact Us</Link>
        </div>
        <div className="search-box">
          <label htmlFor="search-input" className="visually-hidden">Search</label>
          <input
            id="search-input"
            type="search"
            placeholder="Search..."
            onChange={handleSearchChange}
            className="search-input"
            aria-label="Search"
          />
          <FontAwesomeIcon icon={faSearch} className="search-icon" aria-hidden="true" />
        </div>
      </nav>
    </header>
  );
};

export default Navbar;
